def calculate_alice_score(s: str) -> int:
    n = len(s)
    count = [0] / n
    poss = []
    ans = 0
    if s[0] == '0':
        count[0] = 0
    else:
        count[0] = 1
    for i in range(1, n):
        if s[i] == '1':
            count[i] = 1 + count[i - 1]
    for i in range(n - 1):
        if count[i] != count[i + 1] - 1:
            poss.append(count[i])
    if count[n - 1] != 0:
        poss.append(count[n - 1])
    poss.sort(reverse=True)
    i = 0
    while i < len(poss):
        ans += poss[i]
        i += 2
    return ans

